import './contact.scss';

const Contact = () => {
  return (
    <>
      <div className="contact" id="contact">
        <div className="left">
          <img src="asset/shake.png" alt="img" />
        </div>
        <div className="right">
          <h2>Contact</h2>
          <form>
            <input type="text" placeholder="Email" />
            <textarea name="" id="" cols="30" row="10"></textarea>
          </form>
        </div>
      </div>
    </>
  );
};

export default Contact;
